import React from "react";
import { useNavigate } from 'react-router-dom'

function Form(props) {
    let navigate = useNavigate();
    return (
    <form onSubmit = { props.getUser }>
        <input type="text" name="userName"></input>
        <button onClick = {() => {
            navigate('/user', { props })
        }}>Search</button>
    </form>
    )
}
export default Form
